import './footer.css';
import logo from '../../assets/images/eco-logo.png';

import { Container, Row, Col } from 'reactstrap';

const Footer = () => {
  return (
    <footer className="footer">
      <Container>
        <Row>
          <Col lg="4">
            <div className="logo">
              <img src={logo} alt="logo" />
              <div>
                <h1>Aydemirler Mobilya</h1>
              </div>
            </div> {/* Buradaki <div/> ifadesi <div>...</div> olarak düzeltilmiştir */}
          </Col>

          <Col lg="3"> </Col>
          <Col lg="2"> </Col>
          <Col lg="1"> </Col>
        </Row>
      </Container>
    </footer>
  );
}

export default Footer;
